public static void main(String[] argv) {
  try {
    ExitUtil.terminate(exec(new Configuration(), argv));
  } catch (ExitUtil.ExitException e) {
    LOG.error(e.toString());
    System.exit(e.status);
  } catch (Exception e) {
    LOG.error(e.toString(), e);
    ExitUtil.halt(-1, e);
  }
}
